var tipuesearch = {"pages": [{'title': 'About', 'text': '此內容管理系統以\xa0 https://github.com/mdecourse/cmsimde \xa0作為 submodule 運作, 可以選定對應的版本運作, cmsimde 可以持續改版, 不會影響之前設為 submodule, 使用舊版 cmsimde 模組的內容管理相關運作. \n 利用 cmsimde 建立靜態網誌方法: \n 1. 在 github 建立倉儲, git clone 到近端 \n 2. 參考\xa0 https://github.com/mdecourse/newcms , 加入除了 cmsimde 目錄外的所有內容 \n 以 git submodule add\xa0 https://github.com/mdecourse/cmsimde \xa0cmsimde \n 建立 cmsimde 目錄, 並從 github 取下子模組內容. \n 3.在近端維護時, 更換目錄到倉儲中的 cmsimde, 以 python wsgi.py 啟動近端網際伺服器. \n 動態內容編輯完成後, 以 generate_pages 轉為靜態內容, 以 git add commit 及 push 將內容推到遠端. \n 4. 之後若要以 git clone 取下包含 submodule 的所有內容, 執行: \n git clone --recurse-submodules \xa0 https://github.com/mdecourse/newcms.git \n', 'tags': '', 'url': 'About.html'}, {'title': '處理錯誤程序', 'text': 'Q 當倉儲git pull+分組倉儲網址後發現無法正常開啟近端 \n A : 將倉儲start鍵放入文字編輯器並且查看，發現有多一個分號（：），將分號刪除並儲存後即可進入近端。 \n RESEASON 原因 ： 因為有人倉儲本身是壞的，因此當其他人gitpull時會讓他人倉儲錯誤，造成倉儲近端損毀。 \n Before \n \n After \n \n Q 為什麼用了git pull 分組倉儲網址完無法正確連結完成並進行改 \n A: \n 先將倉儲中最新版本反向拉回（左為本身，右為管理者）並且git commit git push上去後再次進入近端即可改為最新版本進行改版推送 \n EX: \n \n RESEASON (原因 ): 有可能因為尚未推送回分組倉儲使最新版本與自身隨身碟中可攜系統舊版沒有連結成功，因此git pull 分組倉儲網址完進入近端才會還是舊版 \n Q 為什麼管理員merge完會使倉儲爆掉，產生舊版與新版衝突(如下) \n \n A: \n 在這次解決問題中，由於近端未有衝突問題並且使用正常，進入近端按下轉靜態後再次git push上傳即可恢復網頁 \n RESEASON (原因 ): \n 有可能是因為其中一位倉儲推送上去使用到git pull的緣故使得新舊版產生合併問題，造成有兩個版面的緣由 \n Q 進入近端卻直接跳下一行並沒有做任何作動 \n EX: \n D:\\87\\cmsimde>python wsgi.py \n D:\\87\\cmsimde> \n A: \n 將啟動程式按鍵(start_mdecourse.bat)拖曳到SciTe裡，並將裡面其中一行程式多餘的開頭程式 %path% 刪除，重新啟動(按下Stop.bat)即可恢復正常。 \n \n 如上圖所示，但前面的 %path%以更改完畢，因此範例中的程式是已經改善完畢的。 \n RESEASON(原因 ): \n 因為%path%為進入近端之bug，需查看是否修正完畢。 \n', 'tags': '', 'url': '處理錯誤程序.html'}, {'title': 'webots', 'text': '\n \n \n', 'tags': '', 'url': 'webots.html'}, {'title': 'Develop', 'text': 'https://github.com/mdecourse/cmsimde \xa0的開發, 可以在一個目錄中放入 cmsimde, 然後將 up_dir 中的內容放到與 cmsimde 目錄同位階的地方, 使用 command 進入 cmsimde 目錄, 執行 python wsgi.py, 就可以啟動, 以瀏覽器 https://localhost:9443\xa0就可以連接, 以 admin 作為管理者密碼, 就可以登入維護內容. \n cmsimde 的開發採用 Leo Editor, 開啟 cmsimde 目錄中的 cmsimde.leo 就可以進行程式修改, 結束後, 若要保留網際內容, 只要將 cmsimde 外部的內容倒回 up_dir 目錄中即可後續對 cmsimde 遠端倉儲進行改版. \n init.py 位於\xa0 up_dir 目錄, 可以設定 site_title 與 uwsgi 等變數. \n', 'tags': '', 'url': 'Develop.html'}, {'title': '每週練習內容', 'text': '', 'tags': '', 'url': '每週練習內容.html'}, {'title': 'Week2', 'text': '課程內容說明、亂數分組、建立各學員網站 \n What is電腦輔助機械設計: \n \n \n 以電腦協助創建、修改、分析或最佳化機械設計 \n 何謂機械設計? \n 固體流體與軟體元件巧妙結合, 達成特定目的 \n 設計 - 權衡約束條件後所完成的安排及表達 \n 設計的目的在尋求目標達成的最合理安排 \n 電腦輔助機械設計的目的在求價值最大化 \n \n 課程目標 \n \n \n 了解何謂電腦輔助機械設計? \n 鼓勵使用合法的教育版 CAD 套件 \n 鼓勵自行開發電腦輔助設計程式 \n 透過分組執行專案, 學習協同設計 \n 透過網站的維護, 學習網際內容管理 \n 透過字幕影片錄製, 學習口語文字表達 \n \n 以下為亂數分組名單網址: \n http://mde.tw/cad2019/content/%E5%88%86%E7%B5%84%E5%90%8D%E5%96%AE.html \n 成員: \n 40523113\xa0吳宜賢 \n 40623252 李展齊 \n 40723101 沈易萱 \n 40723103 林晏瑩 \n 40723107 王晨佑 \n 40723114 杜永瀚 \n 40723119 林哲緯 \n 40723122 施東勝 \n 40723124 徐敬倫 \n 40723125 張詠全 \n 40723152 陳俊任 \n 40723155 吳明峰 \n \n \n', 'tags': '', 'url': 'Week2.html'}, {'title': 'Week3', 'text': '任務一 Solvespace 編譯與參數繪圖應用說明 \n', 'tags': '', 'url': 'Week3.html'}, {'title': 'Week5', 'text': 'Solvespace 編譯與參數繪圖示範 \n \n', 'tags': '', 'url': 'Week5.html'}, {'title': 'Week6', 'text': '\xa0V-rep 網際雙輪車控制模擬示範 \n', 'tags': '', 'url': 'Week6.html'}, {'title': 'Week7', 'text': '網站統一架構，Solvespace編譯與繪圖驗證 \n 1.分組網站規格統一 \n \n 2.solvespace編譯操作證明 \n \n 並 將solvespace將adout的version版本後加上this\xa0solvespace is compiled\xa0 by\xa0 40723103 \n 步驟1 .先查詢GPL關鍵字找到該文件 \n \n 步驟2. 最後在SciTe裡找到該程式碼(大約坐落在952行)並加上 this\xa0 solvespace is compiled\xa0 by\xa0 40723103證明有編譯過。 \n 3.Solvespace操作 \n', 'tags': '', 'url': 'Week7.html'}, {'title': 'Week8', 'text': 'Leo 設定網址路徑和名稱 \n step1. \n 打開D槽中自己倉儲的config裡pelican.leo的檔案(在Leo\xa0裡開啟)，另外再打開Y槽tmp裡的cp2019/config/pelican.leo裡 \n 在Leo裡將cp2019的編輯tamplate/@path theme/...底下@edit base的程式全部複製並貼上在相同位置的自己的倉儲pelican.leo裡，之後做儲存 \n \xa0 \n step2. \n Leo中共用裡@edit\xa0 pelicanconf.py 修改 \n AUTHOR =自己學號 \n SITENAME =cad2019學號 \n step3. \n Leo中遠端裡@edit publishconf.py修改 \n 1. SITEURL =https://倉儲帳號.github.io/cad2019/blog \n 2. DISQUS_SITENAME =Disqus名稱 \n 註:指令ctrl+I=為一個節點，意思是增加一個檔案 \n 以下為範例影片與更改所在位置 \n \n \n', 'tags': '', 'url': 'Week8.html'}, {'title': 'Week9', 'text': '期中報告繳交 \n 期中影片需有 浮水印 \n 期中blog成品展現 \n \n blog網誌網址: \n https://s40723103.github.io/cad2019/blog/index.html \n', 'tags': '', 'url': 'Week9.html'}, {'title': 'Week10-11', 'text': 'fork組別並推送資料pull request 給組長(管理者) \n 分別翻譯電子書之內容，依序NX\xa0 \xa0Solid work\xa0\xa0 inventor\xa0\xa0Creo(proe)=oneshape\xa0逐一寫出軟體特性與分析之間的差異性。 \n ntroduction Pull request \n 正反向拉回差別在於資料傳遞的方向。 \n 假設是正向拉回，是 組員(無權限)將資料推送回組別倉儲後給組長(管理員)確認資料後使其合併 。 \n 反之，反向拉回是 管理者將權限給予組員讓他們擁有可merge的權力 ，不過在這邊很常因為組員推送問題產生衝突，並且解決方式較為繁瑣，因此這學期並不推薦使用反向拉回的方式管理組別倉儲。 \n 以下為正向拉回範例: \n step1 \n \n 先點入自己分組倉儲之pull request，出現畫面為(圖1) \n \n 這時出現merge問題，但仍可以pull request，並按下Create \n pull request之按鍵 \n step2 確認完再按下標題與傳遞內容後再按下 Create  pull request \n step3 出現畫面代表衝突檔案，需由管理員(組長)確認資料並合併之後處理衝突版面並再次推送， 藉此merge完成 \n \xa0 \n \xa0', 'tags': '', 'url': 'Week10-11.html'}, {'title': 'Week12', 'text': '\n 網址: https://www.youtube.com/watch?v=tgTjdzZdQTk \n 心得: \n 對於剛接觸兩款軟體的新手而言， NX12 為接受度較高的高階套件，模擬與加工程序與應力分析和繪製3D草圖為該套件之特色，並且指令相對於簡潔明瞭，運用在繪製草圖或是物件分析的部分都做得相對周到，儘管模擬加工方面之限制比較多之外，整體操作上較為順手。 \n 另一方面 Webots 主要為3D模擬套件，實際使用物體去模擬移動位置，可變換出不同場景已供參考，在設定操作步驟方面相對繁瑣，而測試機器人與機械傳動件作動為該套件主要特性，也可指定對象的圖形和物理屬性。 \n 註 :圖形屬性包括對象的形狀，尺寸，位置和方向，顏色和紋理。 \n 結論: 兩者套件比較下，個人偏向使用NX操作，因操作明瞭標示明顯，各指令也會給予相對詳細的解說，是新手也能操作順手的軟體。 \n \xa0 \n 第十二週筆記 : \n 利用webots(開放式)和v-rep(無開放檔案格式) \n 運用: \n nx12=可二次開發 \n nx3無開發 \n webots:有五種程式可運用，ex:C、C++、Python、Java、MATLAB，為零組件組合軟件。 \n 註解:建立模型孔需有間隙(SOLVESPACE)，因轉出零件檔案(零件件數有多少，就轉多少次)，再轉入WEBOTS。 \n 目前因WEBOTS還是商用化，因此檔案仍停留在1999年。 \n \n', 'tags': '', 'url': 'Week12.html'}, {'title': 'Week13', 'text': '第13週-Solvespace 與 NX12 參數繪圖與 V-rep 結合應用 \n 重點筆記: 講解NX3與NX12之間特性、差異 \n NX3 使用輸出VRML[選VRML2.0，轉入Webots(副檔名.wrl)] 並勾選選項 1.output lights 2.output matenals 3.recursive multi file 註 : 1.imput VRML為Webots打開之檔案類型 2.solvespace無法轉成wrl檔 3.wrl檔為文字檔 NX12 重要檔案 1.NXASSEMBLY(作用為轉檔)=IGES也是轉檔 2.NXBIN 3.UGII 註: 1.Journal=畫圖中並同時儲存 比較差異 \n NX3 =較陽春，但簡便，可執行放在UGII檔裡 \n NX12 =規格、功能性相對齊全，但為了配合Windows 7之後的升級改版，直接將大部分檔案放在NXBIN裡，不過有些重要檔案仍儲存在UGII裡。 \n HOW TO\xa0將NX12程式語言改成Python \n A : \n 改寫位置之操作順序: File>Preferences>User interface>Tools \n 原先Journal language中將Visual Basic選項改為Python選項 \n 目的: 主要方面日後藉由程式去操作NX12 \n', 'tags': '', 'url': 'Week13.html'}, {'title': 'Week14', 'text': '任務 : \n 同步 啟動跨組自評與互評機制 , 並針對課程內容所要求的任務要項逐一查驗各組員學習成效, 希望在鼓勵組員公開倉儲內容與教學影片互相學習之餘, 也能達到公平計分的目的，同時也強制性規定需作筆記。 \n 在第十四週也逐步介紹NX、Solvespace、Webots的執行與互動 \n Q.如何用SciTe執行Python，與 NX、Solvespace、Webots互動 \n A: 程式由外部控制虛擬、實體(大略贅述，詳情敘述只紀錄關鍵字) \n 片刻紀錄 : \n 1 .關鍵字:nx run journal=用python執行，但沒跑出原始碼。 \n 2 .需放Download裡(只是demo)=可直接給路徑<path:path>名稱(yrl.學號)，使學號在路徑連結。 \n 3.cmsimde@...=為release轉出版本，會改變數字。 \n', 'tags': '', 'url': 'Week14.html'}, {'title': 'Week15', 'text': '\n 在這6週裡學到了關於nx、solvespace、webots、solidwork、v-rep相關知識，也了解老師為何都只上一些就跳到下一個步驟，就是為了先讓學生自行產生興趣再去自行學習，儘管如此，龐大的資訊量與軟件相關設定步驟等等諸如此類的東西在整理筆記時也重新審視這一週的收穫，操作影片過程有時也會遇到指令看不懂與操作失誤的部分，同時也累積自身學習體驗的經歷，整體來說，是收穫不少，可能因時間倉促的因素讓進度的步調顯得有些快，不過也讓人印象深刻。 \n', 'tags': '', 'url': 'Week15.html'}]};